import React from 'react'

export default function Image_comp() {
    return (
        <>
            <div className='right_data mt-5' style={{ width: "100%" }}>
                <div className='sign_img mt-5'>
                    <img src='assets/sign.svg' style={{ maxWidth: 400 }} />
                </div>
            </div>
        </>
    )
}
